import Link from 'next/link'

export default function Person({ book }) {

  return (
    <li>
      <Link href="/person/[id]" as={`/book/${book.id}`}>
        <a>{book.name}</a>
      </Link>
      <img src={book.img} />
    </li>
  )
}
